Naujas „Audi“ automobilis užfiksuotas Vilniuje. Iki šiol policijos automobiliai buvo balti su žalia juosta ant šonų. Dabar siūlomi nauji variantai. „Šiuo metu labai atkakliai ir intensyviai dirbame dėl policijos automobilių dizaino pakeitimų. Dizainas dar šiuo metu nagrinėjimo procese. Vyksta svarstymas, tačiau jau prieiname galutinio varianto“, – neslėpė Lietuvos kelių policijos atstovė  Marija Kazanovič . Pareigūnė patvirtino, kad internete paplitusioje nuotraukoje matomas dizainas greičiausiai nedaug skirsis nuo galutinio varianto. Nuotraukoje užfiksuotas  automobilis , kurio priekinė ir galinė dalis pažymėta žaliais dizaino elementais, o ištisinės juostos jau nebėra. „Tas užfiksuotas yra vienas iš galimų variantų. Tačiau – dar negalutinis. Tai vienas iš realiausių variantų, tačiau jis dar bus tobulinamas“, – DELFI teigė M. Kazanovič. Senieji policijos automobiliai išliks tokie patys, kokie yra dabar ir jų dizainas nebus keičiamas. Tačiau visi nauji automobiliai bus ženklinami nauju dizainu. „Planuojame, kad naujo dizaino pristatymas vyks dar šį mėnesį“, – teigė M. Kazanovič. (function(d, s, i, r) {
